package application.ewallet.infrastructure.adapters.output.imageManager;

import application.ewallet.application.output.imageManager.ImageManagerOutputPort;
import application.ewallet.domain.exceptions.WalletException;
import application.ewallet.infrastructure.utilities.ImageConverter;
import lombok.extern.slf4j.Slf4j;
import org.apache.commons.lang3.StringUtils;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.NullSource;
import org.junit.jupiter.params.provider.ValueSource;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;

import java.io.IOException;

import static org.junit.jupiter.api.Assertions.*;

@Slf4j
@SpringBootTest
class CloudinaryAdapterTest {
    @Autowired
    private ImageManagerOutputPort imageManagerOutputPort;
    private static final String T_PAIN = "C:\\Users\\Semicolon\\IdeaProjects\\walletApplication\\src\\main\\resources\\assets\\T pain.jpg";

    private static final String AWWAL = "C:\\Users\\Semicolon\\IdeaProjects\\walletApplication\\src\\main\\resources\\assets\\WhatsApp.jpg";

    private static final String EBUKA = "C:\\Users\\Semicolon\\IdeaProjects\\walletApplication\\src\\main\\resources\\assets\\Ebuka.jpg";

    private static final String DIDDY = "C:\\Users\\Semicolon\\IdeaProjects\\walletApplication\\src\\main\\resources\\assets\\Diddy.jpg";

    private static final String content = "";

    @Test
    void uploadImage() throws WalletException, IOException {

        String response = imageManagerOutputPort.uploadImage(content);
        log.info("AWWAL {}", response);
        assertNotNull(response);
    }

    @Test
    void uploadTPain() throws WalletException, IOException {
        String response = imageManagerOutputPort.uploadImage(ImageConverter.encodeImageToBase64(T_PAIN));
        log.info("T-pain {}", response);
        assertNotNull(response);
    }

    @Test
    void uploadCat() throws WalletException, IOException {
        String response = imageManagerOutputPort.uploadImage(ImageConverter.encodeImageToBase64(EBUKA));
        log.info("Ebuke {}", response);
        assertNotNull(response);
    }

    @Test
    void uploadEbuka() throws WalletException, IOException {
        String response = imageManagerOutputPort.uploadImage(ImageConverter.encodeImageToBase64(DIDDY));
        log.info("Image---> {}", response);
        assertNotNull(response);
    }

    @ParameterizedTest
    @NullSource
    @ValueSource(strings = {StringUtils.EMPTY, StringUtils.SPACE, "23245"})
    void uploadImageInput(String element) {
        assertThrows(WalletException.class, () -> imageManagerOutputPort.uploadImage(ImageConverter.encodeImageToBase64(element)));
    }
}